@BottomBarNavGraph(start = true)
@Destination
@Composable
fun HomeScreen(
    navigator: DestinationsNavigator,
    user: Login?
) {
    //TODO: MOCK REMOVE WHEN DATA FROM API RETRIVED
    val imgBitmap = remember {
        ""
    }
    Column {
        Row(
            modifier = Modifier
                .fillMaxWidth()
                .padding(
                    horizontal = 18.dp,
                    vertical = 12.dp
                ),
            horizontalArrangement = Arrangement.SpaceBetween,
            verticalAlignment = Alignment.CenterVertically
        ) {
            Text(
                text = "Hi, ${user?.customer?.username}!",
                color = MaterialTheme.colors.onBackground,
                fontSize = 20.sp,
                fontWeight = FontWeight.SemiBold
            )
            Image(
                painter = painterResource(pl.better.foodzilla.R.drawable.foodzilla_dino_logo),
                contentDescription = "avatar",
                contentScale = ContentScale.Crop,
                modifier = Modifier
                    .size(40.dp)
                    .clip(CircleShape)
            )
        }
        Row(
            modifier = Modifier
                .fillMaxWidth()
                .padding(
                    horizontal = 18.dp
                )
        ) {
            TextFieldSearch(
                modifier = Modifier
                    .fillMaxWidth()
                    .padding(
                        horizontal = 16.dp,
                        vertical = 11.dp
                    )
                    .shadow(2.dp),
                value = "",
                label = "Search recipes",
                icon = Icons.Default.ArrowForward,
                textColor = MaterialTheme.colors.onBackground,
                onTextChanged = { /*TODO*/ }
            )
        }
        Row(
            modifier = Modifier
                .fillMaxWidth()
                .padding(18.dp)
        ) {
            Text(
                text = "Recommendations",
                color = MaterialTheme.colors.onBackground,
                fontSize = 16.sp,
                fontWeight = FontWeight.SemiBold
            )
        }
        LazyVerticalGrid(
            modifier = Modifier
                .fillMaxSize(),
            columns = GridCells.Fixed(2)
        ) {
            items(
                listOf(
                    Recipe(
                        1,
                        "Hot dog",
                        "Awesome hot dog with an egg, china vibes. GOOOOOOOOOOOOOOOD!",
                        imgBitmap,
                        listOf("Buy a dog", "Place an egg on dog's head"),
                        4.5f,
                        30,
                        512,
                        listOf(RecipeReview(1L, "Noice", 5.0f), RecipeReview(2L, LoremIpsum(1000).values.joinToString(separator = " "), 4.0f)),
                        listOf("Dog", "Egg", "Salt"),
                        listOf("China", "HotDog", "30-minute preparation", "Healthy")
                    )
                )
            ) {
                Row(
                    modifier = Modifier.fillMaxWidth(),
                    horizontalArrangement = Arrangement.SpaceAround
                ) {
                    ImageRecipe(
                        modifier = Modifier
                            .fillMaxWidth(0.8f)
                            .height(180.dp)
                            .clip(RoundedCornerShape(30.dp)),
                        recipe = it,
                        onClick = {
                            navigator.navigate(RecipeDetailsScreenDestination(it))
                        }
                    )
                }
            }
        }
    }
}